import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>To-Do List</h1>
      </header>
      <div style={{ height: 500, width: 500, border: 1 }}></div>
    </div>
  );
}

export default App;
